import React from 'react';

const TweetTextList = ({tweet}) => ( 
    <>
    <div className="grid-container2">
        {tweet.map((thistweet, key) => (
            <>
            <div className="tweet" key={key}>
                <p>{thistweet.text}</p>
            </div> 
            </>
        ))}
        {tweet.user.map((thisuser, key) => (
            <div key={key}> 
            <h4>{thisuser.name} {thisuser.screen_name} <img src={thisuser.profile_image_url} alt="cannot display" /></h4>
            <p>{thisuser.location}</p>
            </div>
        ))} 
    </div>
    </>
)

export default TweetTextList;
